INSERT INTO `kasdeutsch_bot_botcontent` VALUES (1,'О конкурсе','Конкурс «Авангард немцев Казахстана» проводится для выявления наиболее известных личностей нашего этноса. Предлагаем Вам принять участие в голосовании. Обратите внимание на то, что изменить выбор, сделанный при голосовании, невозможно.','Спасибо Вам за участие! Следите за результатами конкурса на сайте wiedergeburt.kz и в наших соцсетях!','Ваш голос уже был учтён!','Обновить ⊕','Назад','avangard-2021-end.jpg','голоса(-ов)','голоса(-ов), включая ваш','Приветствуем Вас! Вы можете отдать только 1 голос в каждой номинации. Кандидаты:','Пожалуйста, обновите информацию о конкурсе!','Я голосую!','Ваш голос за этого номинанта был учтён','demo_upd_bot.jpg','Вы уже проголосовали в данной номинации','demo_user_bot.jpg','след. фото >','< пред. фото','Скрыть биографию','Биография','Нажимая на кнопку \"Поделиться контактом\", Вы соглашаетесь с передачей Ваших контактных данных. Данная процедура необходима для минимизации привлечения сторонних сервисов и возможности обратной связи с организаторами.','+ Поделиться контактом');
