INSERT INTO `kasdeutsch_bot_competition` VALUES (13,'Конкурс «Авангард немцев Казахстана»',0,'По аналогии с конкурсом «Лучшие имена немцев России» Общественный фонд «Казахстанское объединение немцев «Возрождение» проводит конкурс «Авангард немцев Казахстана». Его цель — выявить имена наиболее известных личностей нашего этноса и сделать их достоянием широкой общественности.\r\n\r\nПодробности ищите по ссылке: http://wiedergeburt-kasachstan.de/konkurs-avangard-nemtsev-kazahstana/','avangard-2021_ydlUBl1.jpg','avangard-partner_2ScntaP.jpg');
