INSERT INTO `kasdeutsch_bot_model` VALUES (44,'Казахстанский переводчик, писатель-прозаик, публицист, литературовед родился 28 октября 1934 года в г. Энгельс. Умер 7 февраля 2015 года. Переводчик классиков казахской литературы (Майлина, Мусрепова, Нурпеисова и др.) на русский язык, автор многочисленных романов, повестей и литературно-критических работ, в центре которых исторический путь и современное положение советских немцев и их национальной литературы. Лауреат Президентской премии мира и духовного согласия (1992). Герольд Бельгер свободно владел казахским языком, работая в сфере трёх культур — казахской, русской и немецкой. \r\nПодробнее читайте по ссылке: http://wiedergeburt-kasachstan.de/book/gerold-belger-takaya-vypala-stezya/','Герольд','Карлович','Бельгер'),(45,'Директор и владелец завода гипсовой лепнины «Dekorgips» родился 13 сентября 1972 г. Проживает в г. Нур-Султан (РК). Активист общества немцев «Возрождение» г. Астана и Акмолинской области, оказывает финансовую поддержку Республиканской немецкой газете «Deutsche Allgemeine Zeitung», а также мероприятиям, проводимым обществом, Ассамблеей народа Казахстана и акиматом г. Нур-Султан. Оказал финансовую помощь при изготовлении памятной доски Герольду Бельгеру, способствует строительству Казахстанско-Немецкого центра в столице. Имеет Почетные грамоты и благодарственные письма от Ассамблеи народа Казахстана, городского акимата, ОФ и РО «Возрождение». В преддверии Дня Независимости республики вклад Алексея Айриха в укрепление национального единства и общественного согласия, последовательное служение идеалам добра и духовному развитию общества был отмечен Благодарственным письмом Ассамблеи народа Казахстана за подписью Елбасы Нурсултана Назарбаева.','Алексей','Августович','Айрих'),(47,'Родился 1.09.1960 года в с. Валерьяновка Кустанайской обл. Депутат, Председатель Комитета по экономическим реформам и региональному развитию Мажилиса Парламента Республики Казахстан, председатель Попечительского совета Общественного фонда «Казахстанское объединение немцев «Возрождение». \r\nВ послужном списке - аким г. Лисаковск, аким Костанайской обл., аким Акмолинской обл., первый вице-министр индустрии и новых технологий, депутат Мажилиса Парламента РК. \r\nНаграды: большой крест за заслуги (ФРГ), орден \"Достык\" 2 ст., Барыс 3 ст., Парасат, \"Кеншi данкы\" второй степени, медаль \"за вклад в создание Евразийского экономического союза\" 1 ст. \r\nПо его инициативе в г. Нур-Султан построена Лютеранская церковь. Активно борется за сохранение немецкого языка в системе образования. Инициатор открытия КНЦ в г. Нур-Султан.','Альберт','Павлович','Рау'),(48,'Казахстанский фристайлист (могул) родился 8 июня 1986 года в г. Усть-Каменогорск. На международных соревнованиях выступает с 2004 года, с тех пор в активе спортсмена множество достойных побед. Чемпион мира среди юниоров по параллельному могулу в Айроло (2007), несколько золотых и бронзовых медалей на этапах Кубка Европы (2008), бронза и серебро в могуле на этапе Кубка мира (2010), Победа на зимней Азиаде-2011 в Алматы, серебро Кубка мира в Китае (2012), на зимней Универсиаде - 2015, золото в параллельном могуле Универсиады-2017 (Алматы); серебро - в рамках первого этапа Кубка мира Рука (Финляндия); серебро Кубка мира по могулу (Китай), 2018 год – серебро Кубка мира в Калгари (Канада); бронза Кубка мира по фристайлу Тазавако (Япония); второе место в общем зачете Кубка мира в могуле. 2020 год – бронза Кубка Мира в Калгари (Канада); бронза Международного турнира FIS Open в Идре (Швеция).','Дмитрий','Александрович','Рейхерд'),(49,'Родилась 16.10.1994 в г. Петропавловск. Мастер спорта международного класса, неоднократная рекордсменка и чемпионка Казахстана в плавании на спине, двукратный серебряный призёр Азиатских игр 2014 Корея, неоднократная чемпионка и рекордсменка возрастных чемпионатов Азии, участница Олимпийских игр Пекин-2008, Лондон-2012, Рио-2016.','Екатерина',NULL,'Руденко (Вышегородцева)'),(50,'Родилась 20.04.1975 в г. Алматы. Заслуженный деятель Республики Казахстан, мастер спорта СССР по художественной гимнастике, член молодежной сборной Советского Союза, неоднократная чемпионка Казахстана. С середины 90-х годов и по сей день со своей группой Fertrauen активно участвует в жизни немецкого этноса. Основательница труппы современного танца «Самрук». Неоднократно представляла «Дни культуры Республики Казахстан» на международном и республиканском уровне, готовила постановку концертных номеров ко Дню города Астаны в 2011 году и к 1000-летию Алматы в 2016 году.\r\nПремия Фонда Первого Президента Республики Казахстан – Елбасы в области культуры и искусства (2010), две первые премии «DanceGames» в Турине (2011), участница «IDO World Championchip Showdance» в Германии, в 2012 году занимает 4 место среди 20 стран в Чемпионате Мира по танцам (Германия), в 2014 - серебряный призер Чемпионата Мира по танцевальному спорту в Праге (Чехия); с 2017 по 2018 гг. работала в цирке duSoleil.','Елена','Давыдовна','Эзау'),(51,'Родилась 04.02.2004 в г. Экибастуз Павлодарской области, занимается музыкой с 6 лет (фортепиано). Нелли является неоднократным лауреатом и дипломантом областных, республиканских и международных конкурсов и фестивалей, многократный обладатель Гран-при конкурсов молодых исполнителей как в Казахстане, так и за рубежом (есть подтверждения в виде отсканированных грамот и дипломов). В 2020 году победила в проекте «ТОП-100 лучших студентов среди учащихся колледжей РК», организованном Министерством образования и науки РК. Принимает активное участие в концертной деятельности.','Нелли','Викторовна','Рерих'),(52,'Член попечительского совета Общественного Фонда КОН \"Возрождение\", Директор НУ «Медицинский Центр «Нур-Авиценум», врач-кардиолог высшей категории, кандидат медицинских наук, независимый медицинский эксперт, родился 5 июля 1947 г.р. в г.Ленинск-Кузнецк Кемеровской области. Сегодня Владимир Антонович - Президент Талдыкорганской Региональной Кардиологической Ассоциации, руководитель секции медико-биологических наук Научного общества немцев Казахстана. Имеет за плечами более 50 печатных работ, защиту кандидатской диссертации и более 10 реализованных проектов с международным участием (в т.ч. инновационный в Казахстане проект по организации центра экстракорпоральной терапии).','Владимир','Антонович','Крайсман'),(53,'Заслуженный врач РК, главный консультант по хирургическим вопросам отделения общей хирургии родился 14 июня 1941г. в селе Грюнфельд Акстафинского района (Азербайджан). С 1978 г. до самой пенсии он проработал врачом в железнодорожной больнице, после выхода на пенсию в 2004 г. продолжает практику и хирургические консультации. В 1991 г. был доверенным лицом Президента РК Н.А.Назарбаева на первых всенародных выборах Президента Республики Казахстан. Являлся депутатом Верховного Совета КазССР XII созыва\r\n- депутат нескольких созывов Советского района и двух созывов городского Совета народных депутатов г.Целиноград, городского созыва КазССР (трех созывов). Член правления общества немцев «Возрождение» г. Астаны и Акмолинской области, в 1998 году открыл Станцию социальной помощи для лиц немецкой национальности. Обладатель 15 государственных наград, в числе которых Орден «Курмет» и «Знак почета», «Отличник здравоохранения РК», «Почетный железнодорожник», «Почетный житель г. Нур-Султан».','Владимир','Альбертович','Баумейстер'),(54,'Археолог, специалист в области изучения памятников каменного века на территории Северного Казахстана родился в 1947 г. в с. Николаевка Есильского района Северо-Казахстанской области. Постоянный и активный член Научного объединения немцев Казахстана (НОНК), отвечал за историческое направление. Активно поддерживал молодых учёных-немцев, в 2008-2012 гг. принимал участие в создании и поддержке Молодежного крыла НОНК. Доктор исторических наук (1992), профессор археологии (1996), член-корреспондент Германского археологического института (1997) и Академии социальных наук Республики Казахстан, член ученого совета по археологии и истории института истории, археологии и этнографии МОН РК (с 1997), автор нескольких научных открытий, в т.ч. одного из сенсационных археологических открытий ХХ века – Ботайской культуры, и более 100 книг и статей по древней истории Северного Казахстана. Профессор Зайберт известен далеко за пределами Казахстана, читал лекции в университетах Оксфорда и Эдинбурга.','Виктор','Фёдорович','Зайберт'),(55,'Кандидат экономических наук, предприниматель, учредитель и генеральный директор международного производственного Консорциума GRP Group (горнодобывающая отрасль). Более 15 лет оказывает финансовую поддержку в деятельности Жезказганского городского общества немцев «Возрождение», содействует в трудоустройстве граждан немецкой национальности. По данным Международной рейтинговой ассоциации г. Гонконг - Топ-менеджер-2018; Мировой лидер в сфере бизнеса за успешную лидерскую и инновационную деятельность – 2019, г.Хьюстон, Техас, «World Confederation Businesses»; Лидер отрасли – 2020. Имеет награды за эффективную деятельность, вклад в устойчивое развитие предпринимательства и экономики Казахстана, за «Вклад в государственный бюджет» (Национальный оргкомитет бизнес-рейтинга в Республике Казахстан).','Владимир','Владимирович','Подлих'),(56,'Выпускница Немецкой театральной академии, окончила магистратуру по специальности режиссер драматического театра. \r\nС 1994 до 2009 год работала в Немецком театре актрисой, затем преподавала в Казахской Национальной академии искусств им. Т.Жургенова на факультете театрального искусства немецкого отделения. В 2015 году возглавила Государственный республиканский академический немецкий драматический театр, став его главным режиссером и идейным вдохновителем. Театр получил новое развитие, объединяя и развивая традиции и ценности театра немцев Советского Союза и современные тенденции. \r\nНаряду со своей основной деятельностью театр не остается в стороне от жизни сообщества немцев Казахстана. Он выступал инициатором и организатором немецких молодежных театральных фестивалей, в том числе в сотрудничестве с Гете-институтом Казахстан,  участвовал в организации и проведении Республиканских фестивалей немецкой культуры, проводимых Ассоциацией общественных объединений немцев Казахстана «Возрождение».','Наташа',NULL,'Дубс');
