INSERT INTO `kasdeutsch_bot_nomination` VALUES (19,'Наука','avangard-2021-wissenschaft.jpg',13,'В данную номинацию принимались заявки от известных ученых из различных областей. Конкурсная комиссия отобрала личности, которые уже много лет вносят существенный вклад в развитие нашей республики. Выбирайте и Вы!'),(20,'Искусство','avangard-2021-kultur.jpg',13,'Кандидаты номинации - лица творческих профессий. Выберите одного из представленных номинантов и голосуйте!'),(21,'Спорт','avangard-2021-sport.jpg',13,'Вашему вниманию представлены известные спортсмены международного класса. Выбирайте и голосуйте!'),(22,'Общественная деятельность','avangard-2021-gesellschaft.jpg',13,'По результатам отбора среди видных общественных деятелей, а также оценки их роли в становлении и развитии немецкого этноса республики решением конкурсной комиссии к награде представляется Альберт Павлович Рау. Подробнее читайте по ссылкам в описании.'),(23,'Меценатство','avangard-2021-business.jpg',13,'В этой номинации Вы познакомитесь с предпринимателями, оказывающими регулярную существенную поддержку движению немцев Казахстана как на региональном, так и республиканском уровне.'),(24,'Выдающиеся личности, ушедшие из жизни','avangard-2021-tod.jpg',13,'В данной номинации, посвященной памяти выдающихся личностей, ушедших из жизни, конкурсная комиссия приняла решение о вручении награды родным Герольда Карловича Бельгера. Подробнее об известном писателе и переводчике читайте по ссылкам в описании.');
